import{_ as i,z as l,A as e,a6 as t}from"./framework.fef63301.js";const a={},o=t('<h1 id="git-常用命令" tabindex="-1"><a class="header-anchor" href="#git-常用命令" aria-hidden="true">#</a> git 常用命令</h1><h2 id="常用命令" tabindex="-1"><a class="header-anchor" href="#常用命令" aria-hidden="true">#</a> 常用命令</h2><ul><li>stash：存储临时代码。</li><li>reset --soft：软回溯，回退 commit 的同时保留修改内容。</li><li>cherry-pick：复制 commit。</li><li>revert：撤销 commit 的修改内容。</li><li>reflog：记录了 commit 的历史操作。</li></ul><h2 id="查询配置信息" tabindex="-1"><a class="header-anchor" href="#查询配置信息" aria-hidden="true">#</a> 查询配置信息</h2><ol><li>列出当前配置：git config --list</li><li>列出repository配置：git config --local --list</li><li>列出全局配置：git config --global --list</li><li>列出系统配置：git config --system --list</li></ol><h2 id="第一次使用git-配置用户信息" tabindex="-1"><a class="header-anchor" href="#第一次使用git-配置用户信息" aria-hidden="true">#</a> 第一次使用git，配置用户信息</h2><ol><li>配置用户名：git config --global user.name &quot;your name&quot;</li><li>配置用户邮箱：git config --global user.email &quot;youremail@github.com&quot;</li></ol><h2 id="其他配置" tabindex="-1"><a class="header-anchor" href="#其他配置" aria-hidden="true">#</a> 其他配置</h2><ol><li>配置解决冲突时使用哪种差异分析工具，比如要使用vimdiff：git config --global merge.tool vimdiff</li><li>配置git命令输出为彩色的：git config --global color.ui auto</li><li>配置git使用的文本编辑器：git config --global core.editor vi</li></ol>',9),r=[o];function c(n,h){return l(),e("div",null,r)}const s=i(a,[["render",c],["__file","index.html.vue"]]);export{s as default};
